# Counts all letters in text ( badletters is null )
def count_letters(word):
    BAD_LETTERS = ""
    return len([letter for letter in word if letter not in BAD_LETTERS])

d = open("hurricane_01.txt", "r")
word = d.read()
count_letters(word)

